// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract KendoApp {
  address public owner;

  struct KendoPlayer{
        string Name;
        string SurName;
        uint8  Age;
        string TechnicalGrade;
    }

  mapping(address => KendoPlayer) public KendoPlayers; 


  constructor() {
        owner = msg.sender;
  }

  function addKendoPlayer(address addr, string memory name, string memory surname,uint8 age, string memory technicalgrade) external {
      //Voters[addr].CanVote = true;
      KendoPlayers[addr].Name = name;
      KendoPlayers[addr].SurName = surname;
      KendoPlayers[addr].Age = age;
      KendoPlayers[addr].TechnicalGrade = technicalgrade;
  }

 function getKendoPlayer(address addr) external view returns(KendoPlayer memory){
      return KendoPlayers[addr];
  }


}
